import React from 'react'
import PropTypes from 'prop-types'

export default function TextForm(props) {
  return (
    <div>
        <h2>Enter the text </h2>
      <div className="mb-3">
        <label for="box" className="form-label">{props.title}</label>
        <textarea className="form-control" id="box" rows="5"></textarea>
    </div>
    </div>
  )
}
